Programa formatiu Mobilitza't Mobile
Et fascina la tecnologia mòbil? Creus que l'ús del mòbil ha canviat la teva manera de relacionar-te amb el teu entorn? I a més, t'agradaria treballar en un sector innovador i de futur aprenent d'una forma diferent?

Si tens entre 18 i 24 anys, tens el títol de Graduat en ESO (i no has finalitzat cap altra formació reglada superior), participa al Programa Mobilitza't Mobile:

// Trobaràs espais per a aprendre  a programar i dissenyar aplicacions mòbils o per a configurar i comercialitzar dispositius mòbils.

// Participaràs en activitats socials i de divulgació de la cultura Mobile.

// Estaràs a la última sobre el sector, les seves tendències i les oportunitats professionals que el Mobile ofereix a la Ciutat de Barcelona.

// Comptaràs amb el suport de mentors/es i tutors/es per a orientar-te durant la teva experiència en el programa.

Per a més informació truca al 673.04.50.88 / 93.403.74.02 o envia un correu electrònic a barcelonatreball@barcelonactiva.cat
O entra a: http://w27.bcn.cat/porta22/cat/assetsocupacio/programes/pagina34359/mobilitzat-mobile.do

Aquest programa està finançat per la Unió Europea en el marc del programa PROGRESS.
